import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Auth from "./Auth";

function App() {
  const onSignup = (e: any) => {
    e.preventDefault();
    alert("signup");
  };

  const onLogin = (e: any) => {
    e.preventDefault();
    alert("login");
  };

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/login"
          element={<Auth onSignup={onSignup} onLogin={onLogin} />}
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
